import React from 'react';
import { Divider } from 'src/ui/common/element/divider';

import './projects.css';

const TechStackTag = (props: {
  bgColor: string;
  textColor?: string;
  techName: string;
}) => <sup
  className='projectTechStackTag'
  style={{
    backgroundColor: props.bgColor,
    color: props.textColor ?? 'rgba(255, 255, 255, 1)',
  }} >
    {props.techName}
  </sup>

export const HomeProjectsByMUSection = props => <section className='homeProjectsByMUSection'>
  <h2>프로젝트</h2>

  <aside className='projectDescriptionAside'>
    <h4>
      MUdev.cc
    </h4>
    <div id='projectTagContainer'>
      <sup>Project C</sup>&nbsp;
      <sup id='projectStatus'>In development</sup>
    </div>
    <Divider style={{ width: '100%', margin: '0 1rem' }} />
    <p>
      개발자를 위한 소규모 커뮤니티
    </p>
    <Divider style={{ width: '100%', margin: '0 1rem' }} />
    <h5>Tech Stacks</h5>
    <h6>Backend</h6>
    <TechStackTag bgColor='rgba(0, 0, 0, 1)' techName='Flask-RESTful' />
    <TechStackTag bgColor='rgba(215, 31, 0, 1)' techName='SQLAlchemy' />
    <TechStackTag bgColor='rgb(51, 103, 145, 1)' techName='PostgreSQL' />
    <h6>Frontend</h6>
    <TechStackTag bgColor='#282c34' textColor='#61dafb' techName='React' />
  </aside>
</section>;
